import styles from "./TitleBar.modules.css"
import { Link } from "react-router-dom";
import logo  from "../../Assets/gengarlogo.png"

const TitleBar = () =>{
    return(
        <>
        <div>
        <img src={logo} alt="" className= "logox" />
        <div className="letras">HOLAS DESDE TITLE BAR</div>
        </div>
        </>
    )
}

export default TitleBar;
